import React from 'react';

const About = () => {
  return (
    <section id="hakkimda" className="section">
      <h2>Hakkımda</h2>
      <p>Yaşar Üniversitesi Yazılım Mühendisliği Bölümü'nden 3.57 not ortalaması ile mezun oldum. 3 yıllık profesyonel deneyime sahip, son derece motive ve deneyimli bir yazılım mühendisiyim. Hızlı tempolu ve iş birliğine dayalı ortamlarda, problem çözme becerilerimi karmaşık zorluklarla başa çıkmak için kullanmayı seviyorum.</p>
    </section>
  );
};

export default About;
